column13:
A sieve frame (118, 122) for a combine comprises: 
a first member (300, 302, 308, 310) that is elongate and has a first end and a second end, wherein the first member extends generally horizontally and in the direction of travel; 
a second member (300, 302, 308, 310) that is elongate and has a first end and a second end, wherein the second member extends generally horizontally and in the direction of travel, wherein the second member is spaced away from the first member, and wherein the second member is disposed generally parallel to the first member; 
a first cross member (304, 306, 312, 314) that is elongate and has a first end and a second end, wherein the first cross member extends longitudinally in a direction that is perpendicular to the direction of travel, wherein said first end of said first cross member is fixed with respect to the first member, wherein said second end of said first cross member is fixed with respect to the second member; and 
a second cross member (304, 306, 312, 314) that is elongate and has a first end and a second end, wherein the second cross member extends longitudinally in a direction perpendicular to the direction of travel, wherein said first end of said second cross member is fixed with respect to the first member, wherein said second end of said second cross member is fixed with respect to the second member; 
characterized in that the first and the second member are extrusions.
